import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Nav from './Nav';
import data from './data.js';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

const templates = data.map(item => {
  return (
    <App
      key={item.id}
      item={item}
    />
  )
})

root.render(
  <>
    <Nav />
    {}
  </>

);
